import React, { memo } from 'react'


import { HeaderV1Wrapper } from './style'

export default memo(function AreaHeaderV1() {
  return (
    <HeaderV1Wrapper>
      <div className='left'>
        <h3 className='title'>热门推荐</h3>
        <div className='keywords'>
          {
            ["华语", "流行", "摇滚", "民谣", "电子"].map((item, index) => (
              <div>
                <span key={index} className="text">{item}</span>
                <span className="divider">|</span>
              </div>
            ))
          }
        </div>
      </div>
      <div className='right'></div>
    </HeaderV1Wrapper>
  )
})
